webpackJsonp([80305389649333],{5507:function(e,t){e.exports={data:{post:{html:'<p>It\'s getting scarey. My sleep pattern is so messed up that I am thinking most clearly between 3:30 and 5:00 am.</p>\n<p><a href="http://scriptingnews.userland.com/backissues/2002/02/28#lb5c2560d5f14fea0ce8d343fe1c158ca">Dave doesn\'t like</a> where the <a href="http://www.google.com">Google home page</a> is going. Funny, I use Google all the time, but almost never use their home page. I never even <a href="http://scriptingnews.userland.com/backissues/2002/02/24#l4b56d78e63170cdd6c8b8f9b5e3f7e06">noticed the Olympic animals</a>. The <a href="http://www.mozilla.org">browsers</a> <a href="http://galeon.sourceforge.net/">I</a> <a href="http://www.konqueror.org/">use</a> <a href="http://www.opera.com/">all</a> have a panel or field to enter a search for Google, so I don\'t even need a <a href="http://www.google.com/palm">lightweight version</a>.</p>',fields:{title:"Clear Head",date:"01 Mar 2002",url:"https://papascott.de/2002-03-01-clear-head/"}}},pathContext:{slug:"/2002-03-01-clear-head/",prev:{fields:{title:"Who's Boss In The EU?",date:"28 Feb 2002",slug:"/2002-02-28-whos-boss-in-the-eu/"}},next:{fields:{title:"Adventure Travel",date:"02 Mar 2002",slug:"/2002-03-02-adventure-travel/"}}}}}});
